-- JsonTypeable things are convertible to our format
class JsonTypeable a where
    toType :: a -> String
    toType a = "unknown"
    toJson :: a -> Value
    default toJson :: ToJSON a => a -> Value
    toJson = toJSON
    -- Function needed to unwrap IO values without needing calls to unsafeIO
    toJsonIO :: a -> IO (String, Value)
    default toJsonIO :: a -> IO (String, Value)
    toJsonIO a = return ((toType a), (toJson a))

-- We support maybe as the null value
instance (JsonTypeable a) => JsonTypeable (Maybe a) where
    toType m = case m of
        Just n -> toType n
        Nothing -> "nothing"
    toJson m = case m of
        Just n -> toJson n
        Nothing -> Null

instance (JsonTypeable a) => JsonTypeable (IO a) where
    -- Calls to `unsafePerformIO` may not produces the expected results, there for `toJsonIO` is preferred, when called
    -- this function, the student has written no clean haskell code
    {-# NOINLINE toType #-}
    toType = toType . unsafePerformIO
    -- Calls to `unsafePerformIO` may not produces the expected results, there for `toJsonIO` is preferred, when called
    -- this function, the student has written no clean haskell code
    {-# NOINLINE toJson #-}
    toJson = toJson . unsafePerformIO
    -- Preferred function call to pass the IO monad results to the judge, avoid `unsafePerformIO`
    toJsonIO m = do
        unwrapped <- m
        toJsonIO unwrapped

instance JsonTypeable W.Word8 where toType _ = "uint8"
instance JsonTypeable W.Word16 where toType _ = "uint16"
instance JsonTypeable W.Word32 where toType _ = "uint32"
instance JsonTypeable W.Word64 where toType _ = "uint64"
instance JsonTypeable I.Int8 where toType _ = "int8"
instance JsonTypeable I.Int16 where toType _ = "int16"
instance JsonTypeable I.Int32 where toType _ = "int32"
instance JsonTypeable I.Int64 where toType _ = "int64"

instance JsonTypeable Float where
    toType _ = "single_precision"
    toJson f =
        if (isNaN f) then (toJSON ("nan":: Text))
        else if (isInfinite f) && f < 0 then (toJSON ("-inf" :: Text))
        else if (isInfinite f) && f > 0 then (toJSON ("inf" :: Text))
        else (toJSON f)
instance JsonTypeable Double where
    toType _ = "double_precision"
    toJson f =
        if (isNaN f) then (toJSON ("nan":: Text))
        else if (isInfinite f) && f < 0 then (toJSON ("-inf" :: Text))
        else if (isInfinite f) && f > 0 then (toJSON ("inf" :: Text))
        else (toJSON f)
instance JsonTypeable Integer where toType _ = "bigint"
instance JsonTypeable Int where toType _ = "integer"

instance JsonTypeable Bool where toType _ = "boolean"
instance JsonTypeable Char where toType _ = "char"

instance JsonTypeable Text where toType _ = "text"
instance {-# OVERLAPPABLE #-} JsonTypeable String where toType _ = "text"

instance {-# OVERLAPPABLE #-} JsonTypeable a => JsonTypeable [a] where
    toType m = "list"
    toJson l = toJSON (map toObject l)

instance () => JsonTypeable () where
    toType _ = "undefined"
    toJson () = Null

